import React from 'react'
import './css/Info.css'
import profilePhoto from '../img/Passport.jpg'

function Info() {
    return (
        <div id="info-container">
            <img id="profile-photo" src={profilePhoto} alt="Profile"></img>
            <div id="name">
                <h1>Aftab Hussain</h1>
                <h2>Frontend Developer</h2>
                <p>raftpilot.com</p>
            </div>
        </div>
    )
}

export default Info;
